import React, { useEffect, useState } from 'react';
import weyeLogo from './eye_w.webp';

function Header() {
    const [windowWidth, setWindowWidth] = useState(window.innerWidth);
    const [windowHeight, setWindowHeight] = useState(window.innerHeight);
    useEffect(() => {
        const handleResize = () => {
            setWindowWidth(window.innerWidth);
            setWindowHeight(window.innerHeight);
        };
        window.addEventListener('resize', handleResize);
        return () => {
            window.removeEventListener('resize', handleResize);
        };
    }, []);

    return (
        <header className="header">
            <div className="header-content">
                {/* Frame 17 */}
                <div style={{
                    position: 'absolute',
                    width: '100%',
                    height: windowWidth < 550 ? '8%' : '10%',
                    left: '0px',
                    top: '0px',
                    background: '#005BBB'
                }}></div>

                {/* InSight and Logo */}
                <div style={{
                    position: 'absolute',
                    display: 'flex',
                    alignItems: 'center',
                    fontFamily: 'Crimson Text',
                    fontStyle: 'normal',
                    fontWeight: '400',
                    fontSize: (windowWidth < 550 || windowHeight < 550) ? '25px' : '40px', 
                    lineHeight: '100%',
                    letterSpacing: '-0.01em',
                    color: '#E4E4E4',
                    left: '39px',
                    top: '2%',
                }}>
                    InSight
                    <img src={weyeLogo}  alt="Eye" style={{ marginLeft: windowWidth < 550 ? '5px' : '10px', 
                    height: windowWidth < 550 || windowHeight < 550 ? '30px':(windowWidth < 900 ? '35px' : '40px'),
                    width: windowWidth < 550 || windowHeight < 550 ? '30px':(windowWidth < 900 ? '35px' : '40px'),
                     }} />
                </div>

                {/* Sign Up */}
                <a href="https://www-student.cse.buffalo.edu/CSE442-542/2024-Spring/cse-442ac/Signup/" style={{
                    position: 'absolute',
                    fontFamily: 'Crimson Text',
                    display: 'inline-block',
                    background: '#FFFFFF',
                    fontSize: (windowWidth < 550 || windowHeight < 550) ? '16px' : '20px',
                    fontWeight: '700',
                    borderRadius: '9.26822px',
                    color: '#000000',
                    textDecoration: 'none',
                    padding: '5px 10px', // Adjust padding as needed
                    left: '39px',
                    top: '2%',
                }}>
                    Sign Up
                </a>

                {/* Log In */}
                <a href="https://www-student.cse.buffalo.edu/CSE442-542/2024-Spring/cse-442ac/Login/" style={{
                    position: 'absolute',
                    fontFamily: 'Crimson Text',
                    display: 'inline-block',
                    background: '#FFFFFF',
                    fontSize: (windowWidth < 550 || windowHeight < 550) ? '16px' : '20px',
                    fontWeight: '700',
                    borderRadius: '9.26822px',
                    color: '#000000',
                    textDecoration: 'none',
                    padding: '5px 10px', // Adjust padding as needed
                    left: '39px',
                    top: '2%',
                }}>
                    Sign In
                </a>

                 {/* Help */}
                 <a href="https://www-student.cse.buffalo.edu/CSE442-542/2024-Spring/cse-442ac/Help/" style={{
                    position: 'absolute',
                    fontFamily: 'Crimson Text',
                    display: 'inline-block',
                    background: '#FFFFFF',
                    fontSize: (windowWidth < 550 || windowHeight < 550) ? '16px' : '20px',
                    fontWeight: '700',
                    borderRadius: '9.26822px',
                    color: '#000000',
                    textDecoration: 'none',
                    padding: '5px 10px', // Adjust padding as needed
                    left: '39px',
                    top: '2%',
                }}>
                    Help
                </a>
            </div>
        </header>
    );
}

export default Header;
